"use strict";

function f_gold(encoded) {
    const n = encoded.length + 1;
    let a = 0, b = 0;
    for (let i = 0; i < n - 1; i += 2) {
        a ^= encoded[i];
    }
    for (let i = 0; i <= n; i++) {
        b ^= i;
    }
    const ans = [a ^ b];
    for (let i = encoded.length - 1; i >= 0; i--) {
        ans.push(ans[ans.length - 1] ^ encoded[i]);
    }
    return ans.reverse();
}
